            this.operation = { id: this.item.id, userId: this.item.userId };
            this.sortieService.getSortieProduits(this.item.id).then((prod) => {
                console.log(prod);
                this.produitsArray = [];
                prod.map(item => {
                    let entity = this.produits.find(elem => elem.id === item.produitId);
                    item.nom = entity.categorie + ' ' + entity.nom;
                    this.produitsArray.push(item);
                });
            });
